import React, {Component} from 'react'
import './todoitems.css'
const TodoItems = (props) => {
    const {items} = props;
    const ListItems = items.map((item) => {
        return (
            <div key={item.id}>
                <p>{item.id}</p>
                <p>{item.name}</p>
                <p>{item.age}</p>
            </div>
        );
    })
    return(
        <div>
            {ListItems}
        </div>
    );
}

export default TodoItems;
